[{"location":"api/#JCGEImportMPSGE-API","page":"API","title":"JCGEImportMPSGE API","text":"","category":"section"},{"location":"api/#JCGEImportMPSGE.JCGEImportMPSGE","page":"API","title":"JCGEImportMPSGE.JCGEImportMPSGE","text":"JCGEImportMPSGE converts MPSGE.jl model objects into JCGE block RunSpecs.\n\n\n\n\n\n","category":"module"},{"location":"api/#JCGEImportMPSGE._import_mpsge_data-Tuple{MPSGE.MPSGEModel, Any}","page":"API","title":"JCGEImportMPSGE._import_mpsge_data","text":"_import_mpsge_data(model, data; name)\n\nInternal: build a detailed RunSpec using precomputed data tables.\n\n\n\n\n\n","category":"method"},{"location":"api/#JCGEImportMPSGE._import_mpsge_minimal-Tuple{MPSGE.MPSGEModel}","page":"API","title":"JCGEImportMPSGE._import_mpsge_minimal","text":"_import_mpsge_minimal(model; name)\n\nInternal: build a minimal RunSpec using production, demand, and endowment flows.\n\n\n\n\n\n","category":"method"},{"location":"api/#JCGEImportMPSGE._scalar_value-Tuple{Any}","page":"API","title":"JCGEImportMPSGE._scalar_value","text":"_scalar_value(x)\n\nInternal: coerce a scalar or MPSGE value to Float64.\n\n\n\n\n\n","category":"method"},{"location":"api/#JCGEImportMPSGE._strip_index_name-Tuple{Symbol}","page":"API","title":"JCGEImportMPSGE._strip_index_name","text":"_strip_index_name(sym)\n\nInternal: strip [idx] suffixes from MPSGE symbol names and normalize separators.\n\n\n\n\n\n","category":"method"},{"location":"api/#JCGEImportMPSGE.import_mpsge-Tuple{MPSGE.MPSGEModel}","page":"API","title":"JCGEImportMPSGE.import_mpsge","text":"import_mpsge(model; name=\"MPSGEImport\", data=nothing)\n\nImport an MPSGE.jl model object into a JCGE RunSpec.\n\nWhen data is provided, it is used to populate a data-rich, MCP-style specification via _import_mpsge_data. Otherwise a minimal structure is built from the MPSGE production and demand trees.\n\n\n\n\n\n","category":"method"},{"location":"usage/#Usage","page":"Usage","title":"Usage","text":"JCGEImportMPSGE converts an MPSGE.jl model object into a JCGE RunSpec.\n\nusing MPSGE, JCGEImportMPSGE\nm = MPSGEModel()\n# define model...\nspec = import_mpsge(m)\n\nWhen the source model is complementarity-based, the importer emits MCP blocks for PATHSolver.","category":"section"},{"location":"citation/#How-to-cite","page":"Citation","title":"How to cite","text":"If you use the JCGE framework, please cite:\n\nBoero, R. JCGE - Julia Computable General Equilibrium Framework [software], 2026. DOI: 10.5281/zenodo.18282436 URL: https://JCGE.org\n\n@software{boero_jcge_2026,\n  title  = {JCGE - Julia Computable General Equilibrium Framework},\n  author = {Boero, Riccardo},\n  year   = {2026},\n  doi    = {10.5281/zenodo.18282436},\n  url    = {https://JCGE.org}\n}\n\nIf you use this package, please cite:\n\nBoero, R. JCGEImportMPSGE.jl - Importer from MPSGE.jl model objects into JCGE. [software], 2026. DOI: 10.5281/zenodo.18335430 URL: https://ImportMPSGE.JCGE.org/ SourceCode: https://github.com/equicirco/JCGEImportMPSGE.jl\n\n@software{boero_jcgeimportmpsge_2026,\n  title  = {JCGEImportMPSGE.jl - Importer from MPSGE.jl model objects into JCGE.},\n  author = {Boero, Riccardo},\n  year   = {2026},\n  doi    = {10.5281/zenodo.18335430},\n  url    = {https://ImportMPSGE.JCGE.org/}\n}\n\nIf you use a specific tagged release, please cite the version DOI assigned on Zenodo for that release (preferred for exact reproducibility).","category":"section"},{"location":"#JCGEImportMPSGE","page":"Home","title":"JCGEImportMPSGE","text":"<picture>\n  <source srcset=\"assets/jcge_importmpsge_logo_dark.png\" media=\"(prefers-color-scheme: dark)\">\n  <img src=\"assets/jcge_importmpsge_logo_light.png\" alt=\"JCGEImportMPSGE\" style=\"max-width: 200px; height: auto;\">\n</picture>\n\nJCGEImportMPSGE is part of the JCGE ecosystem. This page provides the package overview and entry points; the API reference is on the next page.","category":"section"}]
